'''デッドボヲルdeホームラン'''是出自BEMANI系列音乐游戏联动活动《热斗！BEMANI STADIUM》的曲目。


{{Hide|标题=YouTube视频|内容={{#widget:YouTube|id=0FiGHCE5gRg‎}}}}

== 简介 ==
活动后半战收录乐曲，曲目作者为猫叉Masterβ2([[猫叉Master]]的别名义)，该名义第一次在pop'n music之外的游戏机种出现。

歌曲以混乱的24分音节拍为标志，GITADORA版虽然没有特殊标题，但音源和其他游戏明显不同。

在IIDX的英文名为「I LIKE DEADBALL」。


